import React, { useEffect } from 'react';
import styles from './UserTests.module.scss';
import { NavLink, Navigate } from 'react-router-dom';
import useAuthStore from '../../stores/authStore';
import Tests from '../../components/tests/Tests';

const UserTests = () => {
    const getTests = useAuthStore(state => state.getUserTests);
    const tests = useAuthStore(state => state.tests);
    const isLogged = useAuthStore(state => state.isLogged);
    const user = useAuthStore(state => state.user);
    const getUser = useAuthStore(state => state.getUser);
    const isLoading = useAuthStore(state => state.isLoading);

    useEffect(() => {
        if (isLogged && user) {
            getTests(user._id);
        } else {
            getUser();
        }
    }, [isLogged, user, getTests, getUser])

    return (
        <>{isLogged ?
            <div className={styles.main}>
                {tests ? <>

                    <h1>{user?.username}</h1>

                    <Tests tests={tests} />
                </> : <ul className={styles.testList}><li className={styles.testItem}><h1 style={{ fontSize: '2rem' }} className={styles.testTitle}>
                    {isLoading ? 'Loading...' : 'You haven\'t created any tests yet'}
                </h1></li></ul>

                }
            </div> : <Navigate to={`/auth/login`} />}</>
    );
};

export default UserTests;
